# @lc code=start
from typing import List

def sign(n: int) -> int:
    return n // abs(n)

class Solution:
    def maxProfit(self, prices: List[int]) -> int:
        # print('original prices', prices, len(prices))

        i = 0
        while i < len(prices) - 1:
            if prices[i] == prices[i + 1]:
                prices.pop(i)
            else:
                i += 1
        # print('no duplicates', prices, len(prices))

        i = 1
        while i < len(prices) - 1:
            if sign(prices[i - 1] - prices[i]) == sign(prices[i] - prices[i + 1]):
                prices.pop(i)
            else:
                i += 1
        # print('no non-extremums', prices, len(prices))

        if len(prices) == 1:
            return 0

        if prices[0] > prices[1]:
            prices.pop(0)

        # print('no starting peak', prices, len(prices))

        if len(prices) == 1:
            return 0

        if prices[-2] > prices[-1]:
            prices.pop(-1)

        # print('no ending drop', prices, len(prices))

        if len(prices) == 1:
            return 0

        assert len(prices) % 2 == 0

        lowest_drop_before = [-1 for _ in prices]
        lowest_drop_before[1] = prices[0]
        best_transactions_before = [-1 for _ in prices]
        best_transactions_before[1] = prices[1] - prices[0]
        for j in range(3, len(prices)):
            lowest_drop_before[j] = min(lowest_drop_before[j - 2], prices[j - 1])
            best_transactions_before[j] = max(best_transactions_before[j - 2], prices[j] - lowest_drop_before[j])

        highest_peak_after = [-1 for _ in prices]
        highest_peak_after[-2] = prices[-1]
        best_transactions_after = [-1 for _ in prices]
        best_transactions_after[-2] = prices[-1] - prices[-2]
        best_profit = best_transactions_after[-2]
        for i in reversed(range(0, len(prices) - 3, 2)):
            highest_peak_after[i] = max(prices[i + 1], highest_peak_after[i + 2])
            best_transactions_after[i] = max(highest_peak_after[i] - prices[i], best_transactions_after[i + 2])
            best_profit = max(best_profit, best_transactions_after[i])

        for i in range(0, len(prices) - 2, 2):
            profit = best_transactions_before[i + 1] + best_transactions_after[i + 2]
            best_profit = max(best_profit, profit)

        return best_profit

